Anonyme brugere kan ikke: 
\n- Oprette grupper; 
\n- Synkronisere grupper og enheder med serveren; 
\n- Administrere grupper og enheder på et personligt betjeningspanel på hjemmesiden.

OsmAnd viser billeder fra flere kilder:
\nOpenPlaceReviews - IP-billeder;
\nMapillary - billeder på gadeniveau;
\nWeb / Wikimedia - IP fotos angivet i OpenStreetMap data.
